// for h5 payment
var verifyOrderRetry = 3;
var pendingMidasParams = null;
function handlePaymentMessage(e) {
	var data = e.data;
	if (typeof data != 'string') {
		return;
	} else if ("aa" == data) {
		document.getElementById('leto_h5_pay_iframe').remove();
	} else if (data.indexOf("mgczf_") != -1) {
		var arr = data.split("_");
		window.top.location.href = arr[1];
	} else {
		// remove h5 payment ui
		var doc = window.NativeGlobal.document;
		doc.getElementById('leto_h5_pay_iframe').remove();

		// remove event handle
		window.removeEventListener('message', handlePaymentMessage);

		// verify
		verifyOrderRetry = 3;
		verifyOrderId(data);
	}
}
function verifyOrderId(orderId) {
	// verify, retry 3 times
	var token = window.mgc.getUserToken();
	var content = {
		app_id: window.__wxConfig__.game_id || '',
		client_id: _const2.default.MGC_CLIENTID,
		from: _const2.default.MGC_FROM,
		agentgame: "",
		timestamp: String(Date.now()),
		device: {
			device_id: _utils2.default.getOrCreateDeviceId(),
			userua: window.NativeGlobal.navigator.userAgent,
			deviceinfo: "iPhone9,2||12.0||2||zh-Hans-CN"
		},
		order_id: orderId,
		user_token: token
	};
	window.mgc.request({
		url: _const2.default.LETO_API_BASE_URL + '/pay/queryorder?data=' + JSON.stringify(content),
		success: function success(res) {
			if (res.data.code == 200) {
				var data = res.data.data;
				var cp_order_id = data.cp_order_id;
				var status = data.status;
				if (2 == status) {
					_bridge2.default.simulateOK('requestMidasPayment', params, {
						cp_order_id: cp_order_id,
						status: status
					});
				} else {
					verifyOrderRetry--;
					if (verifyOrderRetry > 0) {
						setTimeout(function () {
							verifyOrderId(orderId);
						}, 0);
					} else {
						_bridge2.default.simulateFail('requestMidasPayment', params);
					}
				}
			}
		},
		fail: function fail(res) {
			verifyOrderRetry--;
			if (verifyOrderRetry > 0) {
				setTimeout(function () {
					verifyOrderId(orderId);
				}, 0);
			} else {
				_bridge2.default.simulateFail('requestMidasPayment', params);
			}
		}
	});
}

